a=[];
b=[];
D=[];
x=[];
y=[];
Or = LBbn(order,n);
for i=1:chromosome %隨機產生初始解
    RR = randperm(n);
    RR = LBrr1(Or,n,RR);
    SS = LBss1(n,GCT,Information,RR,L1,L2);
%     SS = LBss1(GCT,Information,RR)%%測試用改LBa5兩處，LBa3兩處，LBss1一處，LBb4一處，LBb一處)
    a=[a;RR];
    b=[b SS];
end
for i1=1:s
    i1
    f=(1./b);
    cc=LBcc(f,chromosome); %輪盤法
    a=[a;a(cc,:)];
    b=[b b(cc)];
    P = round(rand()*(10-1)+1,0);
    if P<=3
        [a,b] = LBa5(n,a,b,crossover,GCT,Information,chromosome,L1,L2);
    else
        [a,b] = LBa3(n,a,b,crossover,GCT,Information,chromosome,L1,L2,Or);
    end
    P1 = round(rand()*(2-1)+1,0);
    if P1==1
        [a,b] = LBb(n,a,b,Or,GCT,Information,mutation,L1,L2);
    else
        [a,b] = LBb4(n,a,b,Or,GCT,Information,mutation,L1,L2);
    end
    B = b(b==min(b));
    D = [D B(1)];
    
    f = min(D);
    if i1 == 1
        x=[x 0];
        y=[y f];
    else
        if y(end) ~= f
            x = [x i1];
            y = [y y(end)];
        end
    end
    y = [y f];
    x = [x i1];
    
end

f

plot(x,y,'LineWidth',2)
title('收斂圖')
xlabel('代數')
ylabel('適應值')

